import React from 'react';
import Typography from '@material-ui/core/Typography';
import Container  from '@material-ui/core/Container';
import Logo from '../../../../public/cerebral_icon.png';

const About = () => (
    <div style={{textAlign: 'center'}}>
        <img style={{width: '75px', height: '75px', marginBottom: '10px'}} src={Logo} alt = "Cerebral Logo" />
        <Container maxWidth="sm">
            <Typography variant="h5" paragraph>
                What is Cerebral?
            </Typography>
            <Typography variant="body1">
                Cerebral is an app designed to help you keep track of your emotions and experiences in an organized and
                clean way to facilitate cognitive therapy. The app uses a journaling component and a weekly survey that
                measures depressive symptoms to try to find relationships between your thought patterns and your depressive
                symptoms. <br/> <br />
                The survey follows a well-documented and historically reliable scale called
                the CESD-R (Center for Epidemiological Studies Depression Scale - Revised)
            </Typography>
        </Container>
    </div>
)

export default About;
